import React, { Component } from 'react';
import {NavLink} from 'react-router-dom';
import './styles/bootstrap.css';
import './styles/bootstrap-grid.css';
import './styles/bootstrap-reboot.css';
import './styles/syles.css';
import {
    Collapse,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem
} from 'reactstrap';
import { NavLink as RRNavLink } from 'react-router-dom';


class Naved extends Component{

    constructor(props) {
        super(props);
        this.toggle = this.toggle.bind(this);
        this.state = {
            isOpen: false,
        };
    }

    toggle() {
        this.setState({
            isOpen: !this.state.isOpen
        });
    }

    render() {
        return (

            <Navbar color="light" light expand="sm">
                <NavbarBrand href="/">Lately - Procastination Tool</NavbarBrand>
                <NavbarToggler onClick={this.toggle}/>
                <Collapse isOpen={this.state.isOpen} navbar>
                    <Nav className="ml-auto" navbar >
                        <NavItem className="navItem">
                            <NavLink tag={RRNavLink} className="nav-link" to="/" activeClassName="active" exact path="/">Home</NavLink>
                        </NavItem>
                        <NavItem className="navItem">
                            <NavLink tag={RRNavLink} className="nav-link" to="/projects" activeClassName="active">Projects</NavLink>
                        </NavItem>
                        <NavItem className="navItem">
                            <NavLink tag={RRNavLink} className="nav-link" to="/board" activeClassName="active">Board</NavLink>
                        </NavItem>
                    </Nav>
                </Collapse>
            </Navbar>
        );
    }
}

export default Naved;
